class NzDemoTreeSelectAsyncComponent {
    constructor() {
        this.expandKeys = ['0-0'];
        this.nodes = [
            {
                title: 'Node1',
                value: '0-0',
                key: '0-0',
                children: [
                    {
                        title: 'Child Node1',
                        value: '0-0-1',
                        key: '0-0-1'
                    },
                    {
                        title: 'Child Node2',
                        value: '0-0-2',
                        key: '0-0-2'
                    }
                ]
            },
            {
                title: 'Node2',
                value: '0-1',
                key: '0-1'
            }
        ];
    }
    onExpandChange(e) {
        const node = e.node;
        if (node && node.getChildren().length === 0 && node.isExpanded) {
            this.loadNode().then(data => {
                node.addChildren(data);
            });
        }
    }
    loadNode() {
        return new Promise(resolve => {
            setTimeout(() => resolve([
                { title: 'Child Node', key: `${new Date().getTime()}-0` },
                { title: 'Child Node', key: `${new Date().getTime()}-1` }
            ]), 1000);
        });
    }
    ngOnInit() { }
}


